import { Component, OnInit, Input } from '@angular/core';
import { AngularFirestore } from '@angular/fire/firestore';
import { MessageService } from 'src/app/service/message.service';

import * as pdfMake from "pdfmake/build/pdfmake";
import * as pdfFonts from 'pdfmake/build/vfs_fonts';

(<any>pdfMake).vfs = pdfFonts.pdfMake.vfs;

import { Plugins, FilesystemDirectory } from '@capacitor/core';

@Component({
  selector: 'app-list-enrolment',
  templateUrl: './list-enrolment.component.html',
  styleUrls: ['./list-enrolment.component.css']
})
export class ListEnrolmentComponent implements OnInit {

  enrolments: any [] = [];
  @Input('name') name: String;
  pages: number = 1;
  getEnrolment: any;
  date = new Date();
  loading: boolean = true;

  constructor( private db: AngularFirestore, private serviceMessage: MessageService ) { }

  ngOnInit(): void {
    this.enrolments.length = 0;
    this.db.collection<any>('enrolments').get().subscribe((result) => {
      result.forEach((enrolment) => {
        const getEnrolment = enrolment.data();
        getEnrolment.id = enrolment.id;

        this.db.doc(enrolment.data().customer.path).get().subscribe((customer) => {

          this.db.doc(enrolment.data().price_typeEnrolment.path).get().subscribe((price) => {
          
            getEnrolment.getCustomer = customer.data();
            getEnrolment.getCustomer.seeable = true;

            getEnrolment.dateStart = new Date (getEnrolment.dateStart.seconds * 1000);
            getEnrolment.dateFinal = new Date (getEnrolment.dateFinal.seconds * 1000);

            getEnrolment.getPrice = price.data();

            this.enrolments.push(getEnrolment);

            this.loading = false;
          }) 
        })
      })
    })
  }

  browseCustomer(name: String){
    this.enrolments.forEach((data) => {
      if(data.getCustomer.name.toLowerCase().includes(name.toLowerCase())
      || data.getCustomer.surname.toLowerCase().includes(name.toLowerCase())){
        data.getCustomer.seeable = true;
      }else{
        data.getCustomer.seeable = false;
      }
    })
  }


  getImageLogo(){
    return 'data:image/png;base64,';
  }

  getBackground(){
    return 'data:image/png;base64,';
  }
  
  getDocumentDefinition() {
    return {
      pageSize: 'A4',

      background: [
        {
            image: this.getBackground(),
            width: 2100,
            height: 2970
        }
      ],

      pageMargins: [ 60, 60, 20, 60 ],

      footer: {
        columns: [
          { 
            text: 'Página : 1',
            bold: true,
            color: 'darkslateblue', 
            alignment: 'right',
            margin: [0, 0, 30, 0]
          }
        ]
      },

      content: [
        {
          image: this.getImageLogo(),
          width: 150,
          height: 150,
          alignment: 'center',
          margin: [0, 20, 0, 20]
        },
        {
          text: 'MecGym - REPORT',
          bold: true,
          fontSize: 25,
          alignment: 'center',
          color: 'darkslateblue',
          margin: [0, 10, 0, 20]
        },
        {
          columns: [
            [{
              text: 'Cliente',
              style: 'header'
            },
            {
              text: this.getEnrolment.getCustomer.name + ' ' + this.getEnrolment.getCustomer.surname,
              style: 'name'
            },
            {
              text: 'Email : ' + this.getEnrolment.getCustomer.email,
              margin: [0, 5, 0, 0]
            },
            {
              text: 'Identificación : ' + this.getEnrolment.getCustomer.identityCard,
            },
            {
              text: 'Celular : ' + this.getEnrolment.getCustomer.cellPhoneNumer,
            },
            ]
          ]
        },
        {
          text: 'Actividad',
          style: 'header'
        },
        {
          columns : [
            [{
              text: this.getEnrolment.getPrice.name,
              style: 'name'
            },
            {
              text: 'Inicio : ' + this.getEnrolment.dateStart.toLocaleString(),
              margin: [0, 5, 0, 0]
            },
            {
              text: 'Fin : ' + this.getEnrolment.dateFinal.toLocaleString(),
            },
            {
              text: 'Subtotal : ' + '$ ' + this.getEnrolment.subtotal,
              margin: [0, 5, 0, 0]
            },
            {
              text: 'IVA : ' + '$ ' + this.getEnrolment.iva,
            },
            {
              text: 'Descuento : ' + '$ ' + this.getEnrolment.discount,
            },
            {
              text: 'TOTAL : ' + '$ ' + this.getEnrolment.total,
            }
          ]
        ]
        },
        {
          text: 'Información',
          style: 'header'
        },
        {
          columns : [
            [{
              text: 'Fecha : ' + this.date.toLocaleString(),
            },
            {
              text: 'Firma : ',
              margin: [0, 10, 0, 0]
            }
            ]
          ]
        }
      ],

      info: {
        title: this.getEnrolment.getCustomer.surname + '_' +  this.date.toLocaleDateString('es-cl') + '_' 
               + this.getEnrolment.getCustomer.identityCard.toString() + '_' 
               + this.getEnrolment.getPrice.name,
        author: 'MecGym',
        subject: 'REPORT',
        keywords: 'REPORT, ONLINE REPORT',
      },

      styles: {
        header: {
          fontSize: 18,
          bold: true,
          margin: [0, 20, 0, 10],
          decoration: 'underline'
        },
        name: {
          fontSize: 16,
          bold: true,
          color: 'darkslateblue'
        }
      }
    };
  }

  getPDF (ID : string){
    let item = this.enrolments.find((data) => {
      return data.id == ID;
    });
      
    this.getEnrolment = item;
    this.getEnrolment.id = ID;

    this.db.doc<any>(item.customer.path).valueChanges().subscribe((customer) => {
      this.db.doc<any>(item.price_typeEnrolment.path).valueChanges().subscribe((price) => {

        this.getEnrolment.getCustomer = customer;
        this.getEnrolment.getCustomer.seeable = true;
        this.getEnrolment.getPrice = price;

        this.getDocumentDefinition();
        const documentDefinition = this.getDocumentDefinition();

        if(documentDefinition){
          this.serviceMessage.confirmation('Creando', 'Por favor, espere... !');

          setTimeout(() => {
            setTimeout(() => {
              pdfMake.createPdf(documentDefinition).download(this.getEnrolment.getCustomer.surname + '_'
                + this.date.toLocaleDateString('es-cl') + '_' 
                + this.getEnrolment.getCustomer.identityCard.toString() + '_' 
                + this.getEnrolment.getPrice.name);
  
                const pdfDocGenerator = pdfMake.createPdf(documentDefinition);
                pdfDocGenerator.getBase64((data) => {
                  const dataBase64 = data;
                  const fileName = this.getEnrolment.getCustomer.surname + '_'
                  + this.date.toLocaleDateString('es-cl') + '_' 
                  + this.getEnrolment.getCustomer.identityCard.toString() + '_' 
                  + this.getEnrolment.getPrice.name + '.pdf';
  
                  const { Filesystem } = Plugins;
                  const { LocalNotifications } = Plugins;

                  Filesystem.writeFile({
                    path: fileName,
                    data: dataBase64,
                    directory: FilesystemDirectory.Documents,
                  }).then((writeFileResponse) => {
                    console.log(writeFileResponse);
                    this.serviceMessage.confirmation('Descargando...', 'Por favor, espere... !');
                    
                    LocalNotifications.schedule({
                      notifications: [
                        {
                          title: fileName,
                          body: 'Descarga completada en Documents',
                          id: 1,
                          schedule: { at: new Date(Date.now() + 1000 * 5) },
                          sound: null,
                          attachments: null,
                          actionTypeId: '',
                          extra: null,
                          smallIcon: 'n_icon',
                        }
                      ]
                    });
                   
                  }).catch((error) => {
                    console.log(error);
                    this.serviceMessage.error('Error', 'Error en la descarga, por favor intente más tarde.');
                  });
                });
            }, 50);
          }, 1200); 
        } else {
          this.serviceMessage.error('Error', 'Error en la creación, por favor intente más tarde.');
        }          
      })
    })
  }

  deleteEnrolment(id: number){
    this.db.doc('enrolments/' + id).delete().then(() => {
      this.serviceMessage.confirmation('Eliminado', 'Registro eliminado con exito!');
      this.ngOnInit();
    }).catch(() =>{
      this.serviceMessage.error('Advertencia', 'Registro no pudo ser eliminado!');
    })
  }

}

